    data: |
      SELECT ALL + 25 * - cor1.col0 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q11691.out
    data: |
      -1600
      -1600
      -1600
      -2000
      -2000
      -2000
      -75
      -75
      -75
